import Parallax from 'parallax-js'
import React, { useEffect } from "react";


export default function Mechanics() {
    useEffect(() => {
        let scene2 = document.getElementById('scene2');
        let scene3 = document.getElementById('scene3');
        let scene4 = document.getElementById('scene4');
        new Parallax(scene2);
        new Parallax(scene3);
        new Parallax(scene4);
    }, [])
    return (
        <section className='mechanics section pt-20 py-32'>
            <div id="scene4">
                <div className='wave' data-depth="1.6"></div>
            </div>
            <div className="container mx-auto">
                <h2 className="text-yellow text-center text-5xl">
                    Условия акции
                </h2>
                <div className="uslovia mt-16 mx-auto">
                    <div className="block p-16 pr-32 text-white golos font-normal text">
                        <div id="scene2">
                            <div data-depth="0.4" className="alien"></div>
                        </div>
                        <p>Соверши покупку на 600 рублей, либо купи товары-спонсоры</p>
                    </div>
                    <div className="block p-16 pr-32 text-white golos font-normal text">
                        {/* <div id="scene3">
                            <div data-depth=".1" className="alien"></div>
                        </div> */}
                        <p>Получи игрушку «Треснутого» на кассе магазина «Дикси»</p>
                    </div>
                </div>
            </div>

        </section>
    )
}
